import { Link,useNavigate } from "react-router-dom";

const Header = () => {
    let navigate = useNavigate();
    return(
      <div>
        <div className="ui inverted segment">
        <div className="ui inverted secondary pointing menu">

            <Link to="/list"> <div className="ui item"><h4>Home</h4></div></Link>
            <Link to="/add"> <div className="ui item"><h4>Create</h4></div></Link>
            <Link to=""> <div className="ui item"><h4>Logout</h4></div></Link>


            {/* <div class="ui search" align="right">
            <input class="prompt" type="text" placeholder="Common passwords..."/>
            <div class="results"></div>
            </div> */}


        </div>
        </div>
        <div align="center" style={{margin:"30px",display:"flex",justifyContent:"center",gap:"20px"}}>
        <h1>NotesList React Application</h1>
        <i className="undo icon" onClick={() => {navigate(-1)}}> </i>
        {/* <button class="ui button black" onClick={() => {navigate(-1)}}>Go Back</button> */}
    </div>

    </div>

    );
}

export default Header;
